create table PMS_BROADCAST
(
    BROADCAST_ID        NUMBER(12)     not null
        constraint PMS_BROADCAST_PK
            primary key,
    OPERATOR_ID         NUMBER(10)     not null,
    BROADCAST_TITLE     VARCHAR2(60)   not null,
    BROADCAST_CONTENT   VARCHAR2(1024) not null,
    SEND_ALL            NUMBER(1)      not null,
    STATUS              VARCHAR2(60)   not null,
    REAL_BROADCAST_TIME TIMESTAMP(6),
    PLAN_BROADCAST_TIME TIMESTAMP(6)   not null,
    CREATE_TIME         TIMESTAMP(6) default CURRENT_TIMESTAMP,
    UPDATE_TIME         TIMESTAMP(6) default CURRENT_TIMESTAMP,
    VERSION             NUMBER(8)    default 0,
    SEND_TYPE           VARCHAR2(60) default 'Broadcast'
)
/

comment on column PMS_BROADCAST.BROADCAST_ID is 'BROADCAST_ID PK'
/

comment on column PMS_BROADCAST.OPERATOR_ID is '發送人員ID'
/

comment on column PMS_BROADCAST.BROADCAST_TITLE is '標題'
/

comment on column PMS_BROADCAST.BROADCAST_CONTENT is '即時訊息內容'
/

comment on column PMS_BROADCAST.SEND_ALL is '是否寄送所有玩家 0:否, 1:是'
/

comment on column PMS_BROADCAST.STATUS is '站內喊話狀態. 0: 刪除 1: 審核不通過, 2: 新增審核中, 3: 審核通過, 4: 刪除審核中, 5: 發送成功'
/

comment on column PMS_BROADCAST.REAL_BROADCAST_TIME is '實際送出時間'
/

comment on column PMS_BROADCAST.PLAN_BROADCAST_TIME is '預計送出時間'
/

comment on column PMS_BROADCAST.CREATE_TIME is '建立時間'
/

comment on column PMS_BROADCAST.UPDATE_TIME is '更新時間'
/

comment on column PMS_BROADCAST.VERSION is '更新版本'
/

comment on column PMS_BROADCAST.SEND_TYPE is 'Broadcast:站內喊話,MobileBroadcast:手機推播'
/

